import React from 'react';
import './DataSection.css';

const DataSection = () => {
    return (
        <section className="data-section" id="data">
            <h2>Datos Recopilados</h2>
            <p>Los datos de PACE incluyen informaci√≥n sobre la calidad del agua, aerosoles y ecosistemas marinos.</p>
            <div className="data-images">
                <img src="data-image1.jpg" alt="Datos 1" />
                <img src="data-image2.jpg" alt="Datos 2" />
            </div>
        </section>
    );
}

export default DataSection;
